import React, { useState, useEffect } from 'react';

function App() {
  const [serverStatus, setServerStatus] = useState('checking');
  const [searchQuery, setSearchQuery] = useState('');
  const [results, setResults] = useState({ stocks: [], funds: [] });

  useEffect(() => {
    checkServerStatus();
  }, []);

  const checkServerStatus = async () => {
    try {
      const response = await fetch('http://localhost:3001/api/health');
      const data = await response.json();
      setServerStatus(data.status);
    } catch (error) {
      setServerStatus('error');
    }
  };

  const handleSearch = async (e) => {
    e.preventDefault();
    if (!searchQuery.trim()) return;

    try {
      const response = await fetch(`http://localhost:3001/api/search?query=${encodeURIComponent(searchQuery)}`);
      const data = await response.json();
      setResults(data);
    } catch (error) {
      console.error('Error searching:', error);
    }
  };

  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: '0 auto', fontFamily: 'Arial, sans-serif' }}>
      <h1 style={{ color: '#333', textAlign: 'center', marginBottom: '30px' }}>NewsSense</h1>

      <div style={{ marginBottom: '20px' }}>
        <p style={{ color: '#666', textAlign: 'center' }}>
          Server Status: <span style={{ color: serverStatus === 'ok' ? 'green' : 'red' }}>
            {serverStatus}
          </span>
        </p>
      </div>

      <form onSubmit={handleSearch} style={{ marginBottom: '30px' }}>
        <input
          type="text"
          value={searchQuery}
          onChange={(e) => setSearchQuery(e.target.value)}
          placeholder="Search stocks or funds..."
          style={{
            width: '100%',
            padding: '10px',
            fontSize: '16px',
            border: '1px solid #ddd',
            borderRadius: '4px',
            marginBottom: '10px'
          }}
        />
        <button
          type="submit"
          style={{
            width: '100%',
            padding: '10px',
            backgroundColor: '#007bff',
            color: 'white',
            border: 'none',
            borderRadius: '4px',
            cursor: 'pointer'
          }}
        >
          Search
        </button>
      </form>

      {results.stocks.length > 0 && (
        <div style={{ marginBottom: '30px' }}>
          <h2 style={{ color: '#333', marginBottom: '15px' }}>Stocks</h2>
          {results.stocks.map(stock => (
            <div key={stock.isin} style={{
              padding: '15px',
              border: '1px solid #ddd',
              borderRadius: '4px',
              marginBottom: '10px'
            }}>
              <h3 style={{ margin: '0 0 10px 0' }}>{stock.name}</h3>
              <p style={{ margin: '5px 0' }}>Ticker: {stock.ticker}</p>
              <p style={{ margin: '5px 0' }}>Price: ₹{stock.lastPrice}</p>
              <p style={{ margin: '5px 0', color: stock.change >= 0 ? 'green' : 'red' }}>
                Change: {stock.change} ({stock.changePercent}%)
              </p>
            </div>
          ))}
        </div>
      )}

      {results.funds.length > 0 && (
        <div>
          <h2 style={{ color: '#333', marginBottom: '15px' }}>Funds</h2>
          {results.funds.map(fund => (
            <div key={fund.isin} style={{
              padding: '15px',
              border: '1px solid #ddd',
              borderRadius: '4px',
              marginBottom: '10px'
            }}>
              <h3 style={{ margin: '0 0 10px 0' }}>{fund.name}</h3>
              <p style={{ margin: '5px 0' }}>NAV: ₹{fund.nav}</p>
              <p style={{ margin: '5px 0', color: fund.change >= 0 ? 'green' : 'red' }}>
                Change: {fund.change} ({fund.changePercent}%)
              </p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default App;
